import React from 'react';
import './App.css';
import image from './Images/Earth.png';
import background from './Images/Background.png'
import searchIcon from './Images/searchIcon.png'
const containerStyle = {
 //backgroundColor:'black',
  // justifyContent: 'center',
  // alignItems: 'center', 
  backgroundImage:`url(${background})`,
  backgroundSize:'cover',
  backgroundColor:'black',
  height:'1000px',
  position:'relative'
};

const searchStyle={
  position:'absolute',
  top:'75%',
  left:'35%',
  outline:'none',
  border:'none',
}

function App() {
  return (
    <>
    <div style={containerStyle}>
      <img src={image} style={{width:'887px', height:'490',  paddingTop:'60px', paddingLeft:'250px'}}/>
    </div> 
    <div className='search' style={searchStyle}>
    <input type='search' style={{height:'64px', width:'433px', borderRadius:'40px', fontSize:'21px', paddingLeft:'13px'}}/>
    <img src={searchIcon}/>
      <button style={{borderRadius:'20px', height:'50px', width:'157px', fontSize:'18px', fontStyle:'bold', backgroundColor:'black', color:'white',outline:'none', position:'absolute', right:'10px', border:'none', top:'7px'}}>Search Space</button>
      <h2 style={{color:'white', textAlign:'center', paddingTop:'20px'}}>"Secrets of universe at your fingertips"</h2>
    </div>
    </>


  );
}

export default App;
